// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title ZKP Voting System with Discrete Log Assurance
/// @dev Non-interactive ZKP for vote validity on-chain
contract ZKPVoting {
    uint256 public constant P = 23;
    uint256 public constant Q = 11;
    uint256 public constant G = 2;
    uint256 public constant H = 3;

    struct Vote {
        uint256 commitment;
        uint256 a0;
        uint256 a1;
        uint256 s0;
        uint256 s1;
        uint256 e0;
        uint256 e1;
        bool verified;
    }

    mapping(address => Vote) public votes;
    mapping(address => bool) public voters;
    uint256 public voteCount;
    address public chairperson;

    event VoteCast(address indexed voter, uint256 commitment);
    event VoteVerified(address indexed voter);

    function modExp(uint256 base, uint256 exp, uint256 modulus) internal pure returns (uint256) {
        uint256 result = 1;
        base = base % modulus;
        while (exp > 0) {
            if (exp % 2 == 1) result = (result * base) % modulus;
            base = (base * base) % modulus;
            exp = exp / 2;
        }
        return result;
    }

    function modInverse(uint256 a, uint256 m) internal pure returns (uint256) {
        (uint256 x,) = extendedGCD(a, m);
        return (x % m + m) % m;
    }

    function extendedGCD(uint256 a, uint256 b) internal pure returns (uint256, uint256) {
        if (a == 0) return (b, 0);
        (uint256 g, uint256 y) = extendedGCD(b % a, a);
        return (g, y - (b / a) * (a / g));
    }

    constructor() {
        chairperson = msg.sender;
    }

    function registerVoter(address voter) external {
        require(msg.sender == chairperson, "Only chairperson");
        require(!voters[voter], "Already registered");
        voters[voter] = true;
    }

    function castVote(uint256 commitment, uint256 a0, uint256 a1, uint256 s0, uint256 s1, uint256 e0, uint256 e1) external {
        require(voters[msg.sender], "Not registered");
        require(!votes[msg.sender].verified, "Already voted");
        votes[msg.sender] = Vote(commitment, a0, a1, s0, s1, e0, e1, false);
        emit VoteCast(msg.sender, commitment);
        verifyVote(msg.sender);
    }

    function verifyVote(address voter) internal {
        Vote storage v = votes[voter];
        bytes32 hash = keccak256(abi.encodePacked(v.commitment, v.a0, v.a1));
        uint256 e = uint256(hash) % Q;
        require(v.e0 + v.e1 == e, "Challenge mismatch");

        uint256 left0 = modExp(H, v.s0, P);
        uint256 right0 = (v.a0 * modExp(v.commitment, v.e0, P)) % P;
        uint256 d = (v.commitment * modInverse(G, P)) % P;
        uint256 left1 = modExp(H, v.s1, P);
        uint256 right1 = (v.a1 * modExp(d, v.e1, P)) % P;

        require(left0 == right0 && left1 == right1, "ZKP failed");
        v.verified = true;
        voteCount++;
        emit VoteVerified(voter);
    }

    function getVoteCount() external view returns (uint256) {
        return voteCount;
    }
}

